import { render } from '@testing-library/react';
import React from 'react'


const EventList = () => {

  // Constructor
	// constructor(props) {
	// 	super(props);

	// 	this.state = {
	// 		items: [],
	// 		DataisLoaded: false
	// 	};
	// }

  this.state = {
    items: [],
    DataisLoaded: false
  };

  const axios = require('axios');
  axios.get('https://www.postman.com/collections/729672539796b9f959df')
  .then(function (response) {
    // handle success
    console.log(response);
  })
  .catch(function (error) {
    // handle error
    console.log(error);
  })
  .then(function () {
    // always executed
  });


  render()
  {
    const { items } = this.state;

    return (
      <div>EventList
        {items.item[0].name}
      </div>
    )
  }
}

export default EventList
